@section('before_footer_scripts')
<script>
    var slideImage = 1;
    var countSlide = {{$count - 1}};
    $(document).ready(function() {
        $('.home_content_image').on('DOMMouseScroll mousewheel', $.debounce(250, function(event) {
            var heightElement = $('.home_content_image').height();
            var $container = $('.home_content_image');
            if (event.originalEvent.wheelDelta > 0 ) {
                var $scrollTo = $('.slide-count-'+ (Math.floor($('.home_content_image').scrollTop()/heightElement) + 1));
                $container.animate({scrollTop: $scrollTo.offset().top - $container.offset().top + $container.scrollTop(), scrollLeft: 0},500); 
            } else {
                var $scrollTo = $('.slide-count-'+ (Math.ceil($('.home_content_image').scrollTop()/heightElement) + 1));
                $container.animate({scrollTop: $scrollTo.offset().top - $container.offset().top + $container.scrollTop(), scrollLeft: 0},500); 
            }
        }));
        $('.openVideo').on('click', function() {
            if ($(this).attr('alt') == 1) {
                $('.videoDetail-'+$(this).attr('rel')+ ' .video').html(
                    '<iframe src="'+$(this).attr('id')+'"></iframe>'
                );
            } else if ($(this).attr('alt') == 2) {
                $('.videoDetail-'+$(this).attr('rel')+ ' .video').html(
                    '<iframe src="'+$(this).attr('id')+'" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>'
                );
            } else {
                $('.videoDetail-'+$(this).attr('rel')+ ' .video').html(
                    '<video controls class="video_detail"><source src="'+$(this).attr('id')+'" type="video/mp4"></video>'
                );
            }
            $('.videoDetail-'+$(this).attr('rel')).fadeIn(500);
        });
        $('.close_video').on('click', function() {
            $('.videoDetail .video').html('');
            $('.videoDetail').fadeOut(500);
        });
        
    });
</script>
@endsection